import React, { useState, useEffect } from 'react';
import './Movie.css';
import { useParams } from 'react-router-dom';

const Movies = () => {
  const location = useLocation();
  const { searchResults } = location.state || { searchResults: [] };

  return (
    <div>
      <h2>Movie Search Results</h2>
      {searchResults.length === 0 ? (
        <p>No results found.</p>
      ) : (
        <ul>
          {searchResults.map((result) => (
            <li key={result.id.videoId}>
              <img src={result.snippet.thumbnails.default.url} alt={result.snippet.title} />
              <p>{result.snippet.title}</p>
              <a href={`https://www.youtube.com/watch?v=${result.id.videoId}`} target="_blank" rel="noopener noreferrer">Watch</a>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};
export default Movies;
